import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';

const ProductDetail = () => {
  return (
    <div>
      <Header />
      <h1>Информация о продукте</h1>
      <p>Здесь будет подробная информация о продукте. Пока что мы ничего не загружаем, но эта страница предназначена для отображения информации о конкретном товаре, когда пользователь на него кликнет.</p>
      <Footer />
    </div>
  );
};

export default ProductDetail;
